import React, { Component,Fragment} from 'react';

class TodoList extends Component{


    constructor(prop){
        super(prop);
        this.state = {
            inputV : "Hello",
            test: []
        };
    }
    render(){
        return(
            <Fragment>
                <input type={this.state.inputV}/>
                <ul>
                    <li>待完成</li>
                    <li>已完成</li>
                </ul>
            </Fragment>
        );
    }
}

export default TodoList;
